	/**
	 * Modula Placeholders
	 *
	 * @return mixed|void
	 * @since 2.3.2
	 */
	public static function modula_albums_placeholders() {

		return apply_filters( 'modula_albums_placeholders', array());

	}

	/**
	 * Placeholders real/front value
	 *
	 * @param $value
	 * @param $object
	 *
	 * @return string|string[]
	 * @since 2.3.2
	 */
	public static function modula_albums_placeholders_value($value,$object) {

		$values = apply_filters('modula_albums_placeholder_values',array('setting'=>array(),'front'=>array()),$object);

		return str_replace( $values['setting'], $values['front'], $value);
	}

